import './Header.css'
const Header= ()=>{

    return (
        <header>
            <h3 className="Nav-title">Title</h3>
        <ul className="flex-ul">
            <li>First Link</li>
            <li>Second Link</li>
        </ul>
        <ul className="flex-ul">
            <li>
                <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.istockphoto.com%2Fphotos%2Fprofile-photo-placeholder&psig=AOvVaw3ZgkYicShBIWGYJeoAxfcw&ust=1698403479480000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCIip4JLEk4IDFQAAAAAdAAAAABAJ" alt="" />
            </li>
        </ul>
       </header>
    );
};

export default Header;
